import styled from "styled-components";

export const MainContainer = styled.div`
  width: 100vw;
  height: calc(100vh - 60px);
  display: flex;
  justify-content: center;
  align-items: center;
  .Container {
    width: 100%;
    max-width: 1366px;
  }
`;

export const Area = styled.div`
  max-width: 300px;
  height: 80vh;
`;
